        content: `“Sadako 3D 2” diễn ra vào thời điểm năm năm sau kể từ “Sadako 3D”, một số diễn viên từng xuất hiện trong phần trước như Seto Koji, Ishihara Satomi, Yamamoto Yusuke và Tayama Ryosei cũng sẽ tham gia vào “Sadako 3D 2”.Truyện phim kể về một sinh viên 24 tuổi tốt nghiệp ngành tâm lý học tên Ando Fuuko (Takimoto đóng) phải nuôi đứa cháu gái 4 tuổi (Hirasawa Kokoro) đóng, con gái của người anh trai Takanori (Seto đóng) và người vợ Akane (Ishihara đóng).Akane chết sau khi sinh con, còn người chồng Takanori đã nghỉ hưu. Mặc dù Takanori không nói với Fuuko những chuyện xảy ra trong quá khứ, nhưng có nhiều bí ẩn bắt đầu phát sinh quanh Nagisa, và Fuuko sớm nhận ra rằng những điều đó đều có liên quan đến “đoạn phim bị nguyền rủa trên mạng” trong vụ án năm năm trước.Cũng như phần đầu tiên, “Sadako 3D 2” sẽ do chính tác giả Suzuki Koji (tác giả “Ringu” – Vòng tròn ác nghiệt) chấp bút phần kịch bản, và vẫn được đạo diễn Hanabusa Tsutomu cầm trịch.Thêm: 'Sadako 3D 2' tung trailer đầu tiên dọa fan hết hồn cùng giọng hát 'gào thét' của TVXQ.Single mới của TVXQ mang tên Scream đã được chọn làm ca khúc chủ đề cho phần 2 bộ phim kinh dị Sadako 3D dù chưa được phát hành. Ngày 4/7, Sadako 3D 2 đã tung trailer đầu tiên rùng rợn, đồng thời các fan cũng có cơ hội nghe trước một đoạn ngắn của Scream.Sadako là phim kinh dị nổi tiếng của Nhật Bản, được Hollywood làm lại với tên The Ring. Năm ngoái, Sadako đã được remake bằng phiên bản 3D, độ kinh dị của phim tăng vọt và "cơn sốt Sadako" lại bắt đầu nổi lên ở Nhật và nhiều quốc gia. Nhà sản xuất phim cho rằng, nhạc phim được thể hiện bởi nhóm TVXQ chính là sự lựa chọn đúng đắn để đẩy mạnh sức hút của phim trong nước và khu vực.Scream sẽ là một ca khúc dance mạnh mẽ khác của TVXQ sau Catch me,Humanoids, B.U.T. Hai thành viên trong nhóm bày tỏ, một bản mix giữa dance và âm hưởng rock với nhịp điệu nhanh, mãnh liệt như Scream vô cùng hoàn hảo với thế giới hãi hùng trong phim kinh dị Sadako. Chang Min còn dí dỏm bổ sung: "Tôi hi vọng rằngSadako và ca khúc mới sẽ khiến nhiều khán giả phải gào thét trong hè này".Bên cạnh đó, TVXQ vừa hoàn thành tour diễn lịch sử 5 Dome TIME của mình tại Nhật với hơn 700 nghìn khán giả và sẽ kết thúc chuỗi concert quanh Nhật của họ tại sân vận động Nissan vào ngày 17-18/8. Đồng thời, TVXQ cũng sẽ tiếp tục tổ chức tour thế giới Catch Me tại nhà hát Nokia (Los Angeles) vào ngày 5/7.`,
