        content: 'Đây là bộ phim tài liệu dài 85 phút của đạo diễn Jin Mo Young, kể về cuộc sống lãng mạn có thực của vợ chồng ông Jo Byeong Man (98 tuổi) và bà Kang Gye Yeol (89 tuổi). Để thực hiện bộ phim tài liệu này, đoàn làm phim đã phải quay từ năm 2012, từ lúc ông bà khỏe mạnh cho đến tận khi ông qua đời. Bộ phim đã lấy đi nước mắt của người dân Hàn Quốc cũng như quốc tế.Hai ông bà sống với nhau hơn 75 năm, có tổng cổng 35 người con, cháu chắt nhưng vẫn sống độc lập trong một môi nhà nhỏ dưới chân núi của tỉnh Gangwon. Hai ông bà chẳng bao giờ to tiếng, đưa cho nhau cái gì cũng nói “cảm ơn bà, cảm ơn ông”.“Ông ấy chẳng bao giờ chê cơm tôi nấu. Cho cái gì cũng khen ngon. Hôm nào đồ ăn ngon thật thì ăn nhiều, không ngon thì ăn ít”Đang quét lá trước sân, ông bốc lá ném vào người bà. “Ơ hay cái ông này, sao đùa dai thế nhỉ?”, bà giận. Ông lão ra ngoài hái hoa dại mang tặng, rồi vòng tay lên đầu món mém “Bà ơi, Saranghae”. Vậy là bà lão lại nở nụ cười tươiBà kể về ông: Ông ấy phải ở rể, làm quần quật như trâu, lấy tôi về lúc tôi còn bé tí. Chẳng dám đụng vào người vợ chỉ mới 14 tuổi. Vì yêu vợ, thương vợ phải về làm dâu khi còn nhỏ, nên ông lão hay có thói quen…sờ mặt bà lão khi ngủ. Cho đến tận khi già vẫn giữ thói quen đó, nhiều khi vô thức, ông lão cứ vừa ngủ vừa vuốt tóc, vuốt mũi, vuốt má bà lão, làm bà bão chẳng ngủ được.Hai ông bà thích mặc đồ Hanbok đôi, đi đâu cũng nắm tay nhau thật chặt. Ăn gì, làm gì cũng đều có nhau.',
