        real_name: 'Seal Team Six: The Raid on Osama Bin Laden (2012)',
        content: 'Bộ phim về chiến dịch tiêu diệt Bin Laden tung ra ngày 4-11, hai ngày trước cuộc bầu cử tổng thống Mỹ 2012.Nhà sản xuất quyền lực của Hollywood là Harvey Weinstein, cũng là người vận động gây quỹ ủng hộ chiến dịch tranh cử cho Tổng thống Obama, quyết định trình chiếu bộ phim kể lại chiến dịch truy quét Osama Bin Laden đúng dịp bầu cử.SEAL Team Six: The Raid on Osama bin Laden (Biệt đội tinh nhuệ 6: Cuộc đột kích Osama Bin Laden) do hãng Weinstein và Voltage Pictures sản xuất, sẽ được trình chiếu trên kênh National Geographic đúng hai ngày trước khi chính thức diễn ra bầu cử.“Bộ phim sẽ nói đến tất cả người dân Mỹ”, giám đốc kênh National Geographic Howard Owens và ông Weinstein nói.Phim do John Stockwell đạo diễn, với sự cộng tác của Nicholas Chartier- nhà sản xuất của phim đoạt Oscar The hurt locker. Bộ phim ngoài phát trên kênh National Geographic cũng sẵn sàng chiếu một ngày sau đó trên Netflix – thương hiệu hàng đầu trong dịch vụ phim ảnh trực tuyến.Trong đoạn trailer mới tung ra hôm thứ sáu vừa rồi xuất hiện những lời thoại rất có lợi cho người đứng đầu nước Mỹ: “Chúng ta sẽ là đội xóa sổ Osama”, và “Tổng thống nước Mỹ đặt cược chức tổng thống vào sứ mệnh này”.Tổng thống Obama là người bật đèn xanh cho chiến dịch của đội quân tinh nhuệ, đánh bại trùm khủng bố ngày 2-5-2011 trong chiến dịch ở Pakistan.“Tôi nghĩ rằng công chúng sẽ bị lôi cuốn từ đầu đến cuối phim. Và tôi cũng rất tự hào là công dân Mỹ góp phần đưa dấu mốc đáng ngạc nhiên của lịch sử nước Mỹ vừa qua, xuất hiện trong hàng chục triệu hộ gia đình Mỹ”, ông Weinstein nói.Bộ phim hứa hẹn làm sống dậy những tranh cãi quanh chiến dịch mang đậm dấu ấn Tổng thống Obama, được xem là cú doping cho cuộc bỏ phiếu, có thể giúp ông tái đắc cử.Dàn diễn viên phim gồm Cam Gigandet, Anson Mount, Freddy Rodiquez, Kenneth Miller và Xzibit.Kendall Lampkin viết kịch bản. Do dựa trên sự kiện lịch sử gây chấn động, nên phim có sự cố vấn của nhiều chuyên gia, trong đó có một sỹ quan hải quân mới nghỉ hưu, nhân viên CIA và một sử gia nghiên cứu Bin Laden, theo nguồn tin của kênh National Geographic.“Trong khi một số đặc điểm của nhân vật được kịch hóa vì lí do sáng tạo, câu chuyện cốt lõi là bức chân dung chính xác về chiến dịch truy quét dài nhất trong lịch sử nước Mỹ”, đại diện nhà sản xuất nói thêm.Bộ phim cùng đề tài của nữ đạo diễn từng đoạt Oscar Kathryn Bigelow (The hurt locker) và nhà biên kịch Mark Boal, có tên Zero dark thirty, đáng ra được tung ra trước bầu cử.Cuối cùng nhà sản xuất quyết định dời lại đến ngày 19-12, do nhiều tranh cãi cho rằng bộ phim giúp tranh cử cho Tổng thống Obama. Còn SEAL six team may mắn không bị buộc tội là có sự giúp đỡ, rò rỉ thông tin mật từ chính quyền của ông Obama như đoàn làm phim Zero dark thirty gặp phải.',
