        content: 'Hai viên cảnh sát William Somerset và David Mills phối hợp điều tra một vụ án phức tạp liên quan đến 7 điều cấm trong Kinh thánh. Hung thủ được dự đoán là do trước kia hắn lớn lên trong môi trường đạo nghiêm khắc nên tâm lí bất ổn và rồi lần lượt giết người dựa trên 7 tội lỗi trong Kinh thánh mà hắn gán cho mỗi người.7 tội lỗi đó là: kiêu hãnh (Pride), ghen tị (Envy), ham ăn (Gluttony), sắc dục (Lust), tức giận (Wrath), tham lam (Greed) và lười biếng (Sloth). Án mạng đầu tiên là một tên béo phì với dòng chữ Gluttony viết bằng máu trên tường. Greed là án mạng xảy ra sau đó ở nơi làm của 1 tên luật sư. Một tên buôn ma túy tên Victor bị giết với tội lười biếng - Sloth. Lust là tội gán cho một cô gái điếm. Cuối cùng, Pride là 1 cô nàng quá mải mê chăm chút bề ngoài của mình.Nếu như David có sức mạnh, sự hấp tấp và chút kiêu ngạo của tuổi trẻ thì William lại có sự điềm tĩnh và suy đoán già dặn qua năm tháng. Tới khi bắt được tên hung thủ - John Doe, qua cuộc đối thoại trên xe với hắn, người xem bắt đầu phải động não suy nghĩ về cách nhìn của hắn với xã hội hơn là chỉ kết luận rằng đây là một kẻ tâm thần...',
