        content: `Bộ phim nói về hành động cứu hàng nghìn người Do Thái tại Ba Lan trong Đại chiến thế giới II đã được nhận các giải Oscar, Quả cầu vàng, BAFTA và Grammy dành cho Phim xuất sắc. Viện điện ảnh Mỹ xếp "Schindler's List" ở vị trí thứ 9 trong danh sách những bộ phim hay nhất mọi thời đại.Tháng 9/1939, không tuyên chiến, phát xít Đức tấn công nước láng giềng Ba Lan, mở màn cuộc chiến tranh thế giới lần thứ hai. Quân đội Ba Lan bị đánh bại sau một tháng giao chiến. Sau khi chiếm đóng Ba Lan, quân Đức dồn tất cả người Do Thái tại nước này vào các trại tập trung ở Krakow.Trong không khí hoảng loạn thời chiến tranh, không ít doanh nhân lại tìm thấy cơ hội làm ăn. Một trong số đó là Oskar Schindler, một doanh nhân người Đức gốc Tiệp Khắc. Ông tới Ba Lan với ý định ban đầu là thành lập một nhà máy để tận dụng nguồn lao động nô lệ của hàng triệu người Do Thái trong các trại tập trung ở Krakow. Bằng những khoản tiền hậu hĩnh và những món quà đắt giá, Schindler đã tạo được mối quan hệ tốt với những quan chức hàng đầu của Đức tại Krakow. Thậm chí ông còn được kết nạp vào đảng Quốc xã và trở thành bạn thân của Julian Scherner, người đứng đầu lực lượng cảnh sát và SS (mật vụ) của lực lượng chiếm đóng. Với những lợi thế đó, Schindler nhanh chóng được cấp giấy phép thành lập một nhà máy sản xuất đồ nấu bếp cho quân đội.Nhưng đến lúc xây dựng xong nhà máy thì Schindler chẳng còn tiền để mua máy móc, thiết bị. Thông qua một kế toán của đảng Quốc xã tên là Itzhak Stern, ông bí mật gặp một số doanh nhân gốc Do Thái để hợp tác làm ăn. Theo sáng kiến của Schindler thì họ sẽ cho ông vay tiền để sản xuất. Đổi lại, ông sẽ cung cấp cho họ một phần sản phẩm để bán ngoài chợ đen. Trong thời điểm đó, đây là một hành động mạo hiểm, vì chính quyền chiếm đóng cấm người Đức quan hệ làm ăn với người Do Thái.`,
